import React, { useState, useEffect } from 'react';
import axios from 'axios';

const TimeElapsed = () => {
  const [startTime, setStartTime] = useState(null);
  const [elapsedTime, setElapsedTime] = useState(null);

  useEffect(() => {
    const interval = setInterval(() => {
      const now = new Date();
      if (startTime) {
        const elapsed = now - startTime;
        setElapsedTime(elapsed);
      }
    }, 1000); // Update every second

    return () => clearInterval(interval);
  }, [startTime]);

  return <div>Elapsed Time: {elapsedTime ? (elapsedTime / 1000).toFixed(2) : 0} seconds</div>;
};

const PrimeComponent = () => {
  const [startRange, setStartRange] = useState('');
  const [endRange, setEndRange] = useState('');
  const [primeNumbers, setPrimeNumbers] = useState([]);
  const [algorithmType, setAlgorithmType] = useState('');
  const [primeCount, setPrimeCount] = useState(0);
  const [primeRecords, setPrimeRecords] = useState([]);

  useEffect(() => {
    handleGetPrimeRecords();
  }, []);

  const handleGetPrimeRecords = async () => {
    try {
      const response = await axios.get('http://localhost:3001/api/data');
      setPrimeRecords(response.data);
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  return (
    <div>
     
      <div>
        <button type="button" onClick={() => handleGetPrimeRecords()}>
          Get Prime Records
          <ul>
          {primeRecords.map((record, index) => (
          <li key={index}>
            <p>Date: {record.Date}</p>
            <p>Start: {record.start}</p>
            <p>End: {record.end}</p>
            <p>Algorithm: {record.algorithm}</p>
            <p>Elapsed time:</p> {/* Move TimeElapsed outside of p */}
            <TimeElapsed />
          </li>
        ))}
          </ul>
        </button>
      </div>
    </div>
  );
};

export default PrimeComponent;
